    @warp
    async def my_BK(self, util, ):
        util.sprites.stage.list_HR.delete_all()
        util.sprites.stage.list_HR.append(0)
        util.sprites.stage.list_HR.append(102)
        util.sprites.stage.list_HR.append(-115)
        util.sprites.stage.list_HR.append(0)
        util.sprites.stage.list_HR.append(div(len(util.sprites.stage.list_HW), 3))
        self.var_Z = "退出"
        self.create_clone_of(util, "_myself_")
        self.var_Z = "滑竿"
        self.create_clone_of(util, "_myself_")
        self.var_E = 0
        for _ in range(10):
            self.var_Z = "成就"
            self.var_E += 1
            self.create_clone_of(util, "_myself_")
            self.var_Z = "数显"
            self.var_AD = 0
            for _ in range(7):
                self.var_AD += 1
                self.create_clone_of(util, "_myself_")
        self.var_Z = ""

    @on_clone_start
    async def clone_start(self, util):
        if eq(self.var_Z, "退出"):
            self.gotoxy(-190, 153)
            self.costume.size = 90
            self.costume.switch("退出")
            while True:
                if self.get_touching(util, "_mouse_"):
                    self.costume.set_effect('brightness', 5)
                    self.costume.size += div((95 - round(self.costume.size)), 3)
                    if util.inputs.mouse_down:
                        self.costume.size = 88
                        self.costume.set_effect('brightness', -5)
                        while not not util.inputs.mouse_down:
                            await self.yield_()
                        self.sounds.play("翻页2")
                        util.send_broadcast("H-退出成就页")
                        if ("封面" in self.var_last):
                            util.send_broadcast("H-主菜单")
                            util.send_broadcast("G-黑幕褪去")
                        else:
                            util.send_broadcast("H-由成就返回暂停")
                else:
                    self.costume.size += div((90 - round(self.costume.size)), 3)
                    self.costume.set_effect('brightness', 0)
                while not not util.inputs.mouse_down:
                    await self.yield_()

                await self.yield_()
        else:
            if eq(self.var_Z, "滑竿"):
                self.gotoxy(217, 99)
                self.costume.size = 60
                self.costume.switch("滑竿")
                while True:
                    if self.get_touching(util, "_mouse_"):
                        self.costume.set_effect('brightness', 5)
                        if util.inputs.mouse_down:
                            self.costume.set_effect('brightness', -8)
                            self.sounds.play("翻页")
                            self.var_E = (self.ypos - util.inputs.mouse_y)
                            while not not util.inputs.mouse_down:
                                self.ypos = (util.inputs.mouse_y + self.var_E)
                                if lt(self.ypos, util.sprites.stage.list_HR[3]):
                                    self.ypos = tonum(util.sprites.stage.list_HR[3])
                                else:
                                    if gt(self.ypos, util.sprites.stage.list_HR[2]):
                                        self.ypos = tonum(util.sprites.stage.list_HR[2])
                                util.sprites.stage.list_HR[1] = div((tonum(util.sprites.stage.list_HR[2]) - self.ypos), (tonum(util.sprites.stage.list_HR[2]) - tonum(util.sprites.stage.list_HR[3])))

                                await self.yield_()
                    else:
                        self.costume.set_effect('brightness', -2)

                    await self.yield_()
            else:
                pass

